import MenuIcon from "@material-ui/icons/Menu";
import green from "@material-ui/core/colors/green";
import RealTimeObjectDetection from "../songil/RealTimeObjectDetection";


const Home = ({children}) => {
    return(
        <>
            <Navbar />
            <Start />
